import './App.css';
import { useEffect, useState } from 'react';
import { getAllCharacters } from './getAllCharacters';

function App() {
  const [character, setCharacters] = useState([]);

  useEffect( () => {
    getAllCharacters().then((character) => {
      setCharacters(character)
    })
  }, []
  )


  return (
    <div className="App">

    </div>
  );
}

export default App;
